const User = () => {
	const template = ` 
        <img class="user" src="http://dev.hoppa.com/images/45/user-desktop@2x.png">
        <div class="header">Front-end challenge</div>
        <br />   
        <p>
            This is a design that you will need to code up and impress us.
        </p> 
        <img class="arrow" src="http://dev.hoppa.com/images/45/arrow-left@2x.png" alt="right-arrow">   
        <img class="arrow-mobile" src="http://dev.hoppa.com/images/45/arrow-up@2x.png" alt="right-up">           
    `;

	return template;
};

export default User;
